import React,{Component} from 'react';
import{Link} from 'react-router-dom';
import {Image} from 'react-bootstrap';
import './Home.css';
export default class Home extends Component{
render(){
    return(
        <div>
            <Image src="assets/foto.png" className="header-image" />
            </div>
    )
}
}
